import React from "react";
import { Link } from "react-router-dom";

import AOS from 'aos'
import 'aos/dist/aos.css';
import {
  Button,
  Card,
  CardBody,
} from "reactstrap";
import {
  Form,
  Icon,
  Input,
  Item
} from "antd"
import Illu from "../../assets/img/photos/illustration-3.png";


const Subdomain = (props) => (
  <React.Fragment>
  <div className="col-8 col-md-6 col-lg-7 offset-md-1 order-md-2 mt-auto mt-md-0 pt-8 pb-4 py-md-11">
    <div data-aos="fade-left">
      <img src={Illu} alt="..." class="img-fluid"/>
    </div>
  </div>

<div className="col-12 col-md-5 col-lg-4 order-md-1 mb-auto mb-md-0 pb-8 py-md-11">
  <h1 className="mb-0 font-weight-bold text-center">
    Is this your account?
  </h1>
  <p className="mb-6 text-center text-muted">
    {props.account.subdomain}
  </p>

  <Form>
    <Form.Item>
    <Input
      name='subdomain'
      value={props.subdomain}
      onChange={''}
      size="large"
      placeholder="My Hub Name"
    />
    </Form.Item>
    <Button onClick={props.nextStep} disabled={props.subdomain.length < 1 ? true : false} color="primary" className="btn btn-block btn-primary" type="submit">
      Create
    </Button>
  </Form>



  <p className="mb-0 font-size-sm text-center text-muted">
    Already Have an Account? <Link to="/auth/sign-in">Sign in</Link>
  </p>

</div>
  </React.Fragment>
);

export default Subdomain;
